/*Table structure for table `card` */

DROP TABLE IF EXISTS `card`;

CREATE TABLE `card` (
  `card_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `card_no` varchar(20) DEFAULT NULL COMMENT '卡片号',
  `card_seq` int(11) DEFAULT NULL,
  `card_kind_no` bigint(20) DEFAULT NULL COMMENT '卡种编号',
  `user_no` bigint(10) DEFAULT NULL COMMENT '用户编号 不一定存在用户绑定',
  `surplus_sales` float DEFAULT NULL COMMENT '剩余金额',
