  `card_status` int(11) DEFAULT '1' COMMENT '卡片状态',
  `card_duetime` datetime DEFAULT NULL COMMENT '卡片有效期',
  `card_usecount` int(11) DEFAULT '-1' COMMENT '卡片可使用次数',
  `card_term` int(11) DEFAULT NULL COMMENT '卡片使用周期',
  PRIMARY KEY (`card_id`),
  KEY `card_cardkind` (`card_kind_no`),
  KEY `card_custom` (`user_no`),
  CONSTRAINT `card_cardkind` FOREIGN KEY (`card_kind_no`) REFERENCES `card_kind` (`card_kind_no`),
