/*Table structure for table `card_sales_record` */

DROP TABLE IF EXISTS `card_sales_record`;

CREATE TABLE `card_sales_record` (
  `card_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '卡片销售编号',
  `card_no` varchar(30) DEFAULT NULL COMMENT '卡号',
  `customer_name` varchar(20) DEFAULT NULL COMMENT '客户姓名',
  `customer_phone` varchar(20) DEFAULT NULL COMMENT '客户电话',
  `unionpay` float DEFAULT NULL COMMENT '银联费用',
  `sales_money` float DEFAULT NULL COMMENT '销售金额',
  `sales_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '销售日期',
  `sales_staff` varchar(20) DEFAULT NULL COMMENT '销售员工',
  `sales_shop` varchar(10) DEFAULT NULL COMMENT '门店',
  PRIMARY KEY (`card_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

