/*Table structure for table `product_balance` */

DROP TABLE IF EXISTS `product_balance`;

CREATE TABLE `product_balance` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号 自动增长',
  `balance_no` varchar(64) DEFAULT NULL COMMENT '结算编号 一个客户的一次结算',
  `consume_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '消费时间',
  `consume_pro_no` bigint(20) DEFAULT NULL COMMENT '消费产品编号',
  `pro_name` varchar(50) DEFAULT NULL COMMENT '产品名称',
  `pro_price` float DEFAULT NULL COMMENT '产品现价',
  `pro_count` int(11) DEFAULT NULL COMMENT '产品数量',
  `staff` int(20) DEFAULT '0' COMMENT '服务员工',
  `cashier` int(20) DEFAULT '0' COMMENT '收银员',
  `user_satisfaction` varchar(20) DEFAULT NULL COMMENT '用户满意度',
  `unionpay` float DEFAULT NULL COMMENT '银联金额',
  `cashprice` float DEFAULT NULL COMMENT '现金付款金额 单次消费收取的现金',
  `dealprice` float DEFAULT NULL COMMENT '抵用金额',
  `extraprice` float DEFAULT NULL COMMENT '额外折扣金额',
  `pay_total` float DEFAULT NULL COMMENT '现金+抵用',
  `product_total` float DEFAULT NULL COMMENT '产品现价*购买数量',
  `custom_no` bigint(20) DEFAULT NULL COMMENT '客户',
  `consume_shop` bigint(20) DEFAULT NULL COMMENT '门店编号',
  PRIMARY KEY (`id`),
  KEY `cus_key` (`custom_no`),
  CONSTRAINT `cus_key` FOREIGN KEY (`custom_no`) REFERENCES `custom` (`custom_no`)
