/*Table structure for table `product_info` */

DROP TABLE IF EXISTS `product_info`;

CREATE TABLE `product_info` (
  `product_no` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '产品编号',
  `product_name` varchar(150) DEFAULT NULL COMMENT '产品名称',
  `product_letter` varchar(30) DEFAULT NULL COMMENT '产品拼音',
  `product_type1` varchar(100) DEFAULT NULL COMMENT '产品大类',
  `product_type2` varchar(100) DEFAULT NULL COMMENT '产品小类',
  `product_price1` float DEFAULT NULL COMMENT '产品价格 元',
  `product_price2` float DEFAULT NULL COMMENT '产品现价 元',
  `product_unit` varchar(32) DEFAULT NULL COMMENT '产品计价单位',
  `product_count` varchar(100) DEFAULT NULL COMMENT '产品规格',
  `product_decs` varchar(300) DEFAULT NULL COMMENT '产品描述',
  `product_cttime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '产品创建时间',
  `product_user` varchar(100) DEFAULT NULL COMMENT '产品录入人',
  PRIMARY KEY (`product_no`)
) ENGINE=InnoDB AUTO_INCREMENT=196 DEFAULT CHARSET=utf8;

